cy.fixture('stores').then(stores => {
  stores.forEach(store => {
    // Home page main-menu anchor links for health check
    cy.visit(store, {
      failOnStatusCode: false
    }, {
      responseTimeout: 10000
    }, {
      followRedirect: true
    });
    cy.acceptCookies();
    cy.validateElement('[data-cy="main-menu-child-elements"]');
    cy.get("a").each($a => {
      const message = $a.text();
      expect($a, message).to.have.attr("href").not.contain("undefined");
    });
    // Retrieve href/anchor values based on the chosen store
    cy.url().then(url => {
      cy.fixture('shippingInfo.json').then(shippingInfo => {
        let listingSelector, brandUrl, brandUrlRegex;
        if (url.includes(shippingInfo.FRANCE.storeUrl)) {
          listingSelector = 'a[href="/marques"]';
          brandUrl = shippingInfo.FRANCE.protocol + shippingInfo.FRANCE.storeUrl + '/marques';
          brandUrlRegex = /marques/;
        } else if (url.includes(shippingInfo.SPAIN.storeUrl)) {
          listingSelector = 'a[href="/marcas"]';
          brandUrl = shippingInfo.SPAIN.protocol + shippingInfo.SPAIN.storeUrl + '/marcas';
          brandUrlRegex = /marcas/;
        } else if (url.includes(shippingInfo.ITALY.storeUrl)) {
          listingSelector = 'a[href="/marche"]';
          brandUrl = shippingInfo.ITALY.protocol + shippingInfo.ITALY.storeUrl + '/marche';
          brandUrlRegex = /marche/;
        } else {
          throw new Error('Invalid store URL');
        }
        // Randomly open a brand
        cy.validateElement(listingSelector).get(listingSelector).invoke('attr', 'href').then(href => {
          cy.visit(brandUrl, {
            failOnStatusCode: false,
            responseTimeout: 10000,
            followRedirect: true
          });
          cy.url().should('match', brandUrlRegex);
          openRandomBrand();
        });
      });
    });
  });
});
